            }), validmu = genthat::with_env(function(mu) TRUE, env = list2env(list(), parent = baseenv())), valideta = genthat::with_env(function(eta) TRUE, 
                env = getNamespace("stats"))), class = "family")), class = "eff")), class = "efflist")
    effects:::plot.efflist(x = eff.edu, axes = list(x = list(rug = FALSE), grid = TRUE))
}




